    const { history } = useReactRouter();
    return (
        <div>
            <div>
                <h1>行き先に迷ってしまいました、どうすればよいでしょうか。</h1>
            </div>
            <div>
                <label>GPSがうまく作動しません。</label>
            </div>
        </div>
    )
}

export default FAQ;
